import {LoginForm} from './components/LoginForm';
import {HomePage} from './components/HomePage'

export default function App() {
  return (
      <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="login" element={<LoginForm />} />
      </Routes>
  );
}
